import React from 'react'
import Item from './Item'

const CardItem = (props) => {
  return (
<div>
    { 
      props.item.map(obj=>{
        return(
           <Item
           key={obj.id}
           id={obj.id}
           myId={obj.myId}
           title={obj.title}
           description={obj.description}
           price={obj.price}
           img={obj.img}
           />
        )
      })
    }
  </div>
  )
}

export default CardItem
